package httpclient;

import java.util.ArrayList;
import java.util.List;

import org.apache.http.Header;
import org.apache.http.NameValuePair;
import org.apache.http.message.BasicNameValuePair;
import org.jsoup.Jsoup;
import org.jsoup.nodes.Document;
import org.jsoup.nodes.Element;
import org.jsoup.select.Elements;

public class MainICBCQA {
	static String __VIEWSTATE = "1";// "";

	static String __EVENTVALIDATION = "2";// "";

	static List<String> detailIds = new ArrayList<String>();

	static int Pager_Control3_lbTotalpageNum = 1;

	public static void main(String[] args) {
		icbcQA();
	}

	private static void icbcQA() {
		/*
		 * 1.
		 */
		String url = "http://www.icbc.com.cn/ICBCCollege/client/page/MainQuestion.aspx?tabIndex=2";
		String response = HttpClientUtil.doPost2Content(url, null, null, null);
		if (response != null) {
			Document doc = Jsoup.parse(response);
			__VIEWSTATE = doc.select("input#__VIEWSTATE").get(0).val();
			__EVENTVALIDATION = doc.select("input#__EVENTVALIDATION").get(0).val();
			Pager_Control3_lbTotalpageNum = Integer
					.parseInt(doc.select("span#Pager_Control3_lbTotalpageNum").get(0).text());
			System.out.println(__VIEWSTATE);
			System.out.println(__EVENTVALIDATION);
			System.out.println(Pager_Control3_lbTotalpageNum);
			//
			Elements trs = doc.select("table#DealedGridView tr");
			for (Element tr : trs) {
				Elements as = tr.select("td a");
				if (as.size() > 1) {
					String id = as.get(1).id();
					detailIds.add(id.replaceAll("_", "\\$"));
				}

			}
		}

		/*
		 * 2.
		 */
		// PageDetail("DealedGridView$ctl02$lb2");
		// PageDetail("DealedGridView$ctl03$lb2");
		for (String id : detailIds) {
			System.out.println(id);
			PageDetail(id);
		}

		/*
		 * 3.2
		 */
		DrPage("2");
		// PageDetail("DealedGridView$ctl02$lb2");
		// PageDetail("DealedGridView$ctl03$lb2");
		for (String id : detailIds) {
			PageDetail(id);
		}

	}

	private static void PageDetail(String string) {
		String url = "http://www.icbc.com.cn/ICBCCollege/client/page/MainQuestion.aspx?tabIndex=2";
		List<NameValuePair> params = new ArrayList<NameValuePair>();
		params.add(new BasicNameValuePair("__EVENTTARGET", string));
		params.add(new BasicNameValuePair("__AskTabStrip_State__", "2"));
		params.add(new BasicNameValuePair("__EVENTARGUMENT", ""));
		params.add(new BasicNameValuePair("__VIEWSTATE", __VIEWSTATE));
		params.add(new BasicNameValuePair("__EVENTVALIDATION", __EVENTVALIDATION));

		Header[] headers = HttpClientUtil.doPost2Headers(url, null, params, null);
		for (Header header : headers) {
			if (header.getName().equals("Location")) {
				url = "http://www.icbc.com.cn" + header.getValue();
				System.out.println("url###################" + url);
				String response = HttpClientUtil.doGet2Content(url, null, null);
				if (response != null) {
					Document doc = Jsoup.parse(response);
					System.out.println(doc.title());
				}
				// System.out.println(response);
			}
		}

	}

	private static void DrPage(String page) {
		String url = "http://www.icbc.com.cn/ICBCCollege/client/page/MainQuestion.aspx?tabIndex=2";
		List<NameValuePair> params = new ArrayList<NameValuePair>();
		params.add(new BasicNameValuePair("__EVENTTARGET", "Pager_Control3$DrPage"));
		params.add(new BasicNameValuePair("__AskTabStrip_State__", "2"));
		params.add(new BasicNameValuePair("Pager_Control3$DrPage", page));
		params.add(new BasicNameValuePair("__VIEWSTATE", __VIEWSTATE));
		params.add(new BasicNameValuePair("__EVENTVALIDATION", __EVENTVALIDATION));
		String response = HttpClientUtil.doPost2Content(url, null, params, null);
		if (response != null) {
			Document doc = Jsoup.parse(response);
			__VIEWSTATE = doc.select("input#__VIEWSTATE").get(0).val();
			__EVENTVALIDATION = doc.select("input#__EVENTVALIDATION").get(0).val();
			System.out.println("__VIEWSTATE=====" + __VIEWSTATE);
			System.out.println("__EVENTVALIDATION=====" + __EVENTVALIDATION);
		}
	}
}
